import React from "react";
import Button from "react-bootstrap/Button";
import Form from "react-bootstrap/Form";
import images1 from "./images/social.JPG";
const Login = () => {
  const [username, setName] = useState("");
  const [password, setPass] = useState("");
  return (
    <div id="loginform">
      <Form id="form">
        <h3
          style={{
            textAlign: "center",
            textShadow: "2px 2px black",
            color: "white",
          }}
        >
          LOG IN
        </h3>
        <Form.Group className="mb-3" controlId="formBasicEmail">
          <Form.Label style={{ color: "white", fontSize: "45px" }}>
            USERNAME
          </Form.Label>
          <Form.Control type="email" placeholder="Enter username" required />
        </Form.Group>

        <Form.Group className="mb-3" controlId="formBasicPassword">
          <Form.Label style={{ color: "white", fontSize: "45px" }}>
            Password
          </Form.Label>
          <Form.Control type="password" placeholder="Password" />
        </Form.Group>
        <Form.Group className="mb-3" controlId="formBasicCheckbox">
          <Form.Check type="checkbox" label="Check me out" />
        </Form.Group>
        <Button variant=" #2c7f86;" type="submit" id="submit">
          Submit
        </Button>
      </Form>
      <div>
        <footer id="footer1">
          <ul class="navbar-nav">
            <li>
              Get connected with us on
              <img
                src={images1}
                alt="My Image"
                style={{ height: "3rem", width: "27rem" }}
              />
            </li>
          </ul>
        </footer>
      </div>
    </div>
  );
};

export default Login;
